package week1.day2;

public class FindOddNumbers {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int maxRange =20;
		for (int i = 0; i <= maxRange; i++) {
			if (i%2==1) {
				System.out.println("ODD Number is : " +i);
				
			}
			
		}

	}

}
